import React from 'react';

const getSizeLevel = ({ id }) => {
  const url = `https://api.nike.com/deliver/available_skus/v1/${id}`;
  fetch(url)
    .then((res) => res.json)
    .then((json) => {
      const level = json.level;
      console.log(level);
    });
};

export default getSizeLevel;
